Class(function UICatchPrompt() {
    Inherit(this, View);
    var _this = this;
    var $this, $wrapper, $icon;
    var _timeout;
    (function() {
        initHTML();
        style()
    })();

    function initHTML() {
        $this = _this.element
    }

    function style() {
        $this.size(140, 140).center().css({
            top: 60,
            marginTop: "",
            marginLeft: -110
        });
        $wrapper = $this.create(".icon");
        $wrapper.size(140, 140);
        $icon = $wrapper.create(".icon");
        $icon.size(140, 140).bg("assets/images/icons/hand-catch.png").transformPoint("30%", "80%");
        $this.hide().css({
            opacity: 0
        })
    }

    function animateIcon() {
        if (!_this.visible) {
            return
        }
        _this.count++;
        if (_this.count > 3) {
            _this.animateOut();
            return
        }
        $wrapper.stopTween().css({
            opacity: 0
        }).tween({
            opacity: 1
        }, 1200, "easeInOutSine", function() {
            $wrapper.stopTween().css({
                opacity: 1
            }).tween({
                opacity: 0
            }, 500, "easeInOutSine", 100)
        });
        $icon.stopTween().transform({
            y: 0,
            rotation: 50,
            x: 40
        }).tween({
            rotation: 0,
            y: 30,
            x: -30
        }, 1800, "easeInOutQuart", function() {
            _timeout = _this.delayedCall(animateIcon, 100)
        })
    }
    this.animateIn = function() {
        if (!$wrapper) {
            return
        }
        _this.visible = true;
        _this.count = 0;
        animateIcon();
        $this.show().css({
            opacity: 0
        }).tween({
            opacity: 1
        }, 500, "easeOutSine", 400)
    };
    this.animateOut = function(callback) {
        if ($this.stopTween) {
            $this.stopTween()
        }
        if (_timeout) {
            clearTimeout(_timeout)
        }
        _this.visible = false;
        $this.tween({
            opacity: 0
        }, 300, "easeOutSine", function() {
            $wrapper.stopTween();
            $icon.stopTween();
            $this.hide();
            if (typeof callback == "function") {
                callback()
            }
        })
    }
});
