Class(function UIThrowPrompt() {
    Inherit(this, View);
    var _this = this;
    var $this, $wrapper, $icon;
    (function() {
        initHTML();
        style()
    })();

    function initHTML() {
        $this = _this.element
    }

    function style() {
        $this.size(140, 140).css({
            left: 10,
            top: "50%",
            marginTop: -100
        });
        $wrapper = $this.create(".icon");
        $wrapper.size(140, 140);
        $icon = $wrapper.create(".icon");
        $icon.size(140, 140).bg("assets/images/icons/hand-throw.png").transformPoint("30%", "80%");
        $this.hide()
    }

    function animateIcon() {
        if (!_this.visible) {
            return
        }
        $wrapper.stopTween().css({
            opacity: 0
        }).tween({
            opacity: 1
        }, 1000, "easeOutSine", function() {
            $wrapper.stopTween().css({
                opacity: 1
            }).tween({
                opacity: 0
            }, 500, "easeOutSine", 500)
        });
        $icon.stopTween().transform({
            y: 40,
            rotation: 120,
            x: 0
        }).tween({
            rotation: 70,
            y: -40,
            x: -20
        }, 2000, "easeInOutQuart", function() {
            _this.delayedCall(animateIcon, 500)
        })
    }
    this.animateIn = function() {
        _this.visible = true;
        animateIcon();
        $this.show().css({
            opacity: 0
        }).tween({
            opacity: 1
        }, 500, "easeOutSine")
    };
    this.animateOut = function() {
        _this.visible = false;
        $this.tween({
            opacity: 0
        }, 300, "easeOutSine", function() {
            $this.hide()
        })
    };
    this.flip = function(isFlipped) {
        $this.tween({
            opacity: 0
        }, 200, "easeOutSine", function() {
            if (isFlipped) {
                $this.transform({
                    scaleY: -1
                })
            } else {
                $this.transform({
                    scaleY: 1
                })
            }
            animateIcon();
            $this.tween({
                opacity: 1
            }, 500, "easeOutSine")
        })
    }
});
